import React, { Component } from "react";

class Posts extends Component {
  render() {
    const { body, title } = this.props;
    return (
      <div
        style={{
          border: "1px grey solid",
          margin: "10px",
          padding: "0px 20px",
        }}
      >
        <h2>{title}</h2>
        <p>{body}</p>
        <button style={p}>Delete</button>
      </div>
    );
  }
}

export default Posts;
